import React from 'react';
import { Link } from 'react-router-dom';


const Navbar = ({ onSearch }) => (
    <div className="navbar">
        <div className="nav-links">
            <Link to="/">Home</Link>
        </div>
        <input
            type="text"
            placeholder="Search music..."
            onChange={(e) => onSearch(e.target.value)}
        />
    </div>
);

export default Navbar;
